namespace LHZ.FastJson.UnitTest
{
    public class TestJsonReder
    {
        [SetUp]
        public void Setup()
        {
        }
        //[Category("JsonReder")]
        [Test]
        public void JsonRead()
        {
            string str = "\"Test\"";
            JsonReader reader = new JsonReader(str);
            Assert.AreEqual("Test", reader.JsonRead().Value.ToString());
            Assert.AreEqual(JsonType.String, reader.JsonRead().Type);

            str = "null";
            reader = new JsonReader(str);
            Assert.AreEqual(str, reader.JsonRead().Value.ToString());
            Assert.AreEqual(JsonType.Null, reader.JsonRead().Type);

            str = "false";
            reader = new JsonReader(str);
            Assert.AreEqual(str, reader.JsonRead().Value.ToString());
            Assert.AreEqual(JsonType.Boolean, reader.JsonRead().Type);
            Assert.AreEqual(BooleanType.False, ((JsonBoolean)reader.JsonRead()).BooleanType);

            str = "true";
            reader = new JsonReader(str);
            Assert.AreEqual(str, reader.JsonRead().Value.ToString());
            Assert.AreEqual(JsonType.Boolean, reader.JsonRead().Type);
            Assert.AreEqual(BooleanType.True, ((JsonBoolean)reader.JsonRead()).BooleanType);

            str = "1235";
            reader = new JsonReader(str);
            Assert.AreEqual(str, reader.JsonRead().Value.ToString());
            Assert.AreEqual(JsonType.Number, reader.JsonRead().Type);
            Assert.AreEqual(NumberType.Long, ((JsonNumber)reader.JsonRead()).NumberType);

            str = "1.235";
            reader = new JsonReader(str);
            Assert.AreEqual(str, reader.JsonRead().Value.ToString());
            Assert.AreEqual(JsonType.Number, reader.JsonRead().Type);
            Assert.AreEqual(NumberType.Double, ((JsonNumber)reader.JsonRead()).NumberType);

            str = "{}";
            reader = new JsonReader(str);
            Assert.AreEqual(JsonType.Content, reader.JsonRead().Type);

            str = "[]";
            reader = new JsonReader(str);
            Assert.AreEqual(JsonType.Array, reader.JsonRead().Type);

            str = "\"sdf\\\"\"";
            reader = new JsonReader(str);
            var result = reader.JsonRead();
            Assert.AreEqual(result.ToJsonString(), str);
            
        }

        [Test]
        [Category("JsonObject")]
        public void ToJsonString()
        {
            string str = "[{\"name\":\"lhz\",\"age\":12},{\"name\":\"lhz\",\"age\":12}]";
            Assert.AreEqual(new JsonReader(str).JsonRead().ToJsonString(), str);
        }

