        [Test]
        [Category("JsonObject")]
        public void JsonReaderIndex()
        {
            string name = "lhz";
            int age = 18;

            string str = $"[{{\"name\":\"{name}\",\"age\":{age}}},{{\"name\":\"{name}\",\"age\":14}}]";
            var jsonObj = new JsonReader(str).JsonRead();
            var jsonContent = jsonObj[0];
            Assert.AreEqual(jsonContent.Type, JsonType.Content);

            var jsonAge = jsonContent["age"];
            Assert.AreEqual(jsonAge.Value, age.ToString());

            var jsonString = jsonContent[0];
            Assert.AreEqual(jsonString.Type, JsonType.String);
            Assert.AreEqual(jsonString.Value, name);

            try
            {
                var jsonUnknow = jsonContent[3];
            }
            catch (Exception ex)
            {
                Assert.IsTrue(ex.GetType().IsAssignableFrom(typeof(ArgumentOutOfRangeException)));
                return;
            }
            throw new Exception(" ArgumentOutOfRangeException ");
        }
